return(
  
    
  props.dados.books.map((a) => <div className='Estante' style={{left:props.dados.x, top:props.dados.y, rotate:props.dados.rotate+"deg", width:props.dados.width, height:props.dados.height}}>
  </div>))


}
export default Estante
